INSERT INTO `blog_posts` VALUES (4,'فیسبوک تیم ویژه فناوری بلاک چین راه می‌اندازد','facebook-runs-blockchain-team','2018-05-18 13:37:20','','5afed7107fb4b4.40597726.jpg','','فیسبوک به تازگی تیمی از کارشناسان خود را برای کار بر روی بلاک چین سازماندهی کرده است. این اقدام می‌تواند گام بلندی توسط این شرکت برای بهره‌گیری از بلاک چین در دنیای مجازی باشد.\r\n\r\nدیوید مارکوس (David Marcus) معاون فیسبوک در واحد اپلیکیشن پیام‌رسان است.<a href=\"#\"> او که پیش </a>از این مدیر پی‌پل نیز بود به تازگی این خبر را اعلام کرد. آقای مارکوس در یک پست فیسبوکی نوشت: «پس از چهار سال فعالیت باورنکردنی و ارزشمند در واحد پیام‌رسان به این نتیجه رسیدم که وقت آن است با چالشی جدید روبرو شوم. در حال ایجاد تیمی کوچک هستم که بتوانیم بهترین شیوه‌های بهره‌گیری از بلاک چین را شناسایی کنیم. این کار اقدامی بنیادین خواهد بود.»\r\n\r\nگزارشی که شبکه خبری رکورد منتشر کرده گویای آن است که حدود ۱۰ نفر در این تیم حضور دارند. مجموعه‌ای از کارشناسان مهندسی و محصول از اینستاگرام در این تیم حضور دارند. البته هنوز مشخص نیست که وظیفه دقیق این تیم چیست. با این وجود این اقدام، گامی مهم از سوی این غول شبکه‌های اجتماعی به شمار می‌رود.\r\n\r\nپیش از این نیز مدیر سابق پی‌پل (که اکنون در هیات مدیره صرافی ارز دیجیتال کوین‌بیس حضور دارد) اعلام کرد که پیام‌رسان فیسبوک پس از اینکه مشکلات بلاک چین برطرف شد، حاضر است از رمزارزها استفاده کند. گفتنی است فیسبوک مدتی پیش هر نوع درج آگهی مربوط به رمزارزها را ممنوع کرد. دلیل این اقدام، کلاهبرداری‌های صورت گرفته در زمینه عرضه اولیه سکه و موارد مشابه بوده است.','published','news',20),(6,'جک ما (بنیانگذار علی بابا): بلاک چین حباب نیست، ولی بیت کوین حباب است','alibaba-jack-mam-blockchain-is-not-bubble','2018-05-18 13:52:20','','5afeda94c05e41.68449703.jpg','jack ma','جک ما (موسس غول چینی تجارت الکترونیک یعنی علی بابا) در یک سخنرانی در دومین کنفرانس جهانی هوش اعلام کرد که بلاک چین یک حباب نیست، ولی بیت کوین را یک حباب می‌داند.\r\n\r\nجک ما اعلام کرد که سال‌هاست بر روی بلاک چین تحقیق می‌کند و به شدت بر این باور است که این فناوری از توانایی لازم برای حل مساله حریم خصوصی برای جامعه، آن هم در تمامی سطوح (دولت، شرکت‌ها و افراد معمولی) در عصر داده‌های بزرگ برخوردار است. او تاکید کرد که امنیت یک اولویت مهم برای علی بابا به عنوان یک شرکت بزرگ در زمینه تجارت الکترونیک به شمار می‌رود. گفتنی است علی بابا در سه ماه چهارم سال گذشته درآمدی بالغ بر ۳۹/۹ میلیارد دلار داشته است.\r\n\r\nجک ما اعلام کرد بخش قابل ملاحظه‌ای از توجه کنونی به صنعت بلاک چین توسط افرادی صورت می‌گیرد که آن را یک «معدن بزرگ طلا» می‌دانند. گفتنی است جک ما دیدگاهی منفی به بیت کوین ندارد. او در دسامبر ۲۰۱۷ که قیمت بیت کوین به اوج خود رسید به خبرنگار شبکه خبری سی‌ان‌بی‌سی گفت: «من اصلا درباره بیت کوین چیزی نمی‌دانم. من واقعا گیج شده‌آم. اگر بیت کوین واقعا کار کند، مقررات مربوط به تجارت جهانی و سامانه‌های پرداخت کاملا تغییر خواهد کرد. فکر می‌کنم هنوز آمادگی لازم را نداریم. به همین دلیل هنوز توجه‌ام به علی‌پی (Alipay) است…به دلار آمریکا و یورو است. ما تیمی داریم که به مطالعه بلاک چین مشغول است. اما بیت کوین چیزی نیست که بخواهم به بررسی آن بپردازم. اهمیتی به بیت کوین نمی‌دهم.»\r\n\r\nبر اساس گزارش بلومبرگ، جک ما سال گذشته توانست ثروتمندترین مرد آسیا شود. ارزش خالص دارایی‌های او از ۴۱/۸ میلیارد دلار نیز فراتر رفت. همچنین سامانه علی‌پی (ویژه پردازش تراکنش‌ها با گوشی) حدود ۴۵۰ میلیون کاربر دارد.\r\n\r\nاین اظهارات جک ما، امیدهایی که برخی به پذیرش ارزهای دیجیتال و به ویژه بیت کوین در سامانه علی‌پی داشتند را نقش بر آب کرد.\r\n\r\n\r\n\r\nجک ما تنها فرد ثروتمندی نیست که دیدگاهی مخالف با بیت کوین دارد. وارن بافت (یکی از ثروتمندترین مردان جهان) نیز چندی پیش اعلام کرد که بیت کوین شبیه قمار است و خرید آن را نمی‌توان سرمایه‌گذاری دانست. همچنین رابرت شیلر (برنده جایزه نوبل اقتصاد در سال ۲۰۱۳) نیز بیت کوین را نوعی حباب دانست که البته به این زودی از بین نمی‌رود.\r\n\r\nدر سوی دیگر این طیف نیز برخی از فعالان سیلیکون ولی قرار دارند. تیم دراپر یکی از معروف‌ترین آنهاست که سابقه درخشانی در سرمایه‌گذاری اولیه بر روی استارتاپ‌هایی نظیر اسکایپ، تسلا و هات میل دارد. تیم دراپر بر این باور است که ارزش بیت کوین طی ۴ سال آینده به بالای ۲۵۰ هزار دلار خواهد رسید. همچنین جک دروسی (بنیانگذار توییتر) هم فکر می‌کند طی ۱۰ سال آینده، بیت کوین تنها ارز معتبر دیجیتال جهان خواهد شد.\r\n\r\nبا این وجود، تغییرات شدید قیمت ارز دیجیتال یکی از مواردی است که پیش‌بینی آینده آن را اندکی دشوار می‌سازد. برای آشنایی با ماهیت این تغییرات و عوامل موثر بر آن توصیه می‌کنیم مطلب «عوامل موثر در قیمت ارز دیجیتال» را مطالعه بفرمایید. ','published','learning',26),(7,'تحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین','Value_system','2018-05-22 19:13:36','اتفاقات نامبارکی در خصوص حریم خصوصی و سوء استفاده از داده‌ها چالش‌های قانونی و نظارتی و … این همچنان فرصتی برای ایجاد اشتغال است. اما نکته مهم این است: ','5b046be0e27d17.09047425.jpg','','<p>به اشتراک‌گذاری عنصر دیرپایی است که در روابط انسان‌ها معانی متغیری دارد. بااین‌حال، اصطلاح «به اشتراک‌گذاری» در مقالات مربوط به اقتصاد نادر است. انقلاب فناوری اطلاعات و ارتباطات (ICT) ظرفیت‌های جدیدی را برای به اشتراک‌گذاری فراهم کرده است. برای اولین بار افرادی که وابستگی ضعیفی به هم دارند می‌توانند در یک پروژه خاص خودسازمان­دهی شوند و ظرفیت خود را به‌صورت داوطلبانه به اشتراک گذارند. از همین رو ICT زمینه ساز ظهور «اقتصاد اشتراکی» در مدل‌های کسب‌وکار شده که در آن‌ها به افراد دسترسی استفاده‌ی موقتی از کالاها یا خدمات را با بهره‌گیری از پلتفرم‌های مشارکتی اماکن پذیر نموده است. با وجود اتفاقات نامبارکی در خصوص حریم خصوصی و سوء استفاده از داده‌ها چالش‌های قانونی و نظارتی و … این همچنان فرصتی برای ایجاد اشتغال است. اما نکته مهم این است: برای آنکه یک فرد بتواند درکسب و کاری سرمایه گذاری کند نیازمند آن است که ارزش مبادله ونحوه محاسبه آن شفاف و تحت نظارت باشد.\r\n</p>\r\n<h4>تحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین</h4>\r\n<p>\r\nطبق نظر عام اقتصادانان ارزش کالا و خدمات شدیداً با عرضه و تقاضا مرتبط است و این موضوع چالش‌ مهمی در نظام قیمت بازار اقتصاد اشتراکی است. لذا ما به دنبال پاسخ یک سؤال اساسی هستیم: چگونه می‌توان ارزش ایجاد شده از طریق سیستم اشتراک اجتماعی را ارزیابی و توزیع کرد؟ موضوعی که در نحوه قیمتگذاری ارزهای دیجیتال هم اکنون بحث برانگیز شده است. حال ما در این پدیده سه فاز پیش روی داریم:\r\n</p>\r\n<ul>\r\n<li>(الف) نحوه ادراکات ارزش در اقتصاد؛ </li>\r\n\r\n<li>(ب) زمینه فنی-اقتصادی اقتصاد اشتراکی؛ </li>\r\n\r\n<li>(ج) گذار به یک نظام ارزش جدید</li>\r\n</ul>\r\n<p>تحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین\r\n\r\nبا توسعه دانش و فناوری اطلاعات، اقتصاد جدیدی شکل گرفت با نام «اقتصاد اطلاعاتی» و یا «اقتصادپساصنعتی» که در آن شیوه جدید سازمان‌دهی منابع مولد شکل گرفت. این سیستم به فرم جدیدی از ساختار اجتماعی منجر شده که در آن «تولید، پردازش و انتقال اطلاعات به منابع بنیادی بهره‌وری و قدرت تبدیل می‌شوند» ازهمین رو بواسطه ICT  اقتصاد اشتراکی از دل جامعه اطلاعاتی پدید آمد و ساختار اجتماعی جدیدی ایجاد شد. به همین دلیل است که شرایط مبتنی بر ICT فعالیت اشتراک اجتماعی را قادر به کسب اهمیت اقتصادی و حتی دسترسی به آنرا تبدیل به مزیت اقتصادی کرده‌اند. در این میان مشکلات و محدودیت هایی رخ داد که شامل «منشا فنی-اقتصادی و راهکار اجتماعی-نهادی» می‌شود.\r\n\r\nاولین مورد نیازمند تعریف «تحول کار و ماهیت کار» است. دراین مدل کسب و کار ( اقتصاد اطلاعاتی) ثروت آفرینی به فرآیندهای مولد اجتماعی بستگی دارد. ارزش به‌طور فزاینده در فرایندهای مشارکتی به‌وسیله «انبوهی» از بازیگران مختلف ایجاد می‌شود و در نتیجه حساسیت کار به کنترل و اندازه‌گیری کمتر می‌شود. کار غیرمادی کیفی‌تر و حتی پیچیده‌تر است و دارایی‌های ناملموس در ارزیابی ارزش اهمیت می‌یابند. این حالت غیرقابل سنجش بودن ارزش، چالش‌ برای مدیریت کسب و کار و به تبع آن حسابداری سنتی ایجاد می‌کند که منجر به کاهش عقلانیت در نظام قیمت گذاری شده.\r\n<p>\r\nمعمای دوم وابستگی شدید این اقتصاد با «ماهیت اطلاعات به عنوان محصول اجتماعی» است. در گذشته ارزش کالاها به‌طور سنتی با کمیابی مرتبط بوده است، درحالی‌که تولید اطلاعات با منطق فراوانی مرتبط است. این منجر به یک پاردوکس در ارزش‌گذاری می‌شود. بدین صورت که اطلاعات تولید شده به عنوان کالا طبقه‌بندی نمی‌شوند، بلکه به عنوان مشترکات جهانی طبقه‌بندی می‌شوند. این مشترک­سازی با اَشکال جدید حاکمیت و تدارک کالاها و خدمات نیز مرتبط است که با مدل های حاکمیت سنتی در تضاد است بارزترین آن ارز دیجیتالی است که متعلق به کشوری نیست بلکه انبوهی از مردم درآن سهیم هستند.\r\n</p>\r\n\r\nتحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین\r\n\r\nمورد سوم در اقتصاد اطلاعاتی مطرح است «اشتراک سازی های رایگان و نرم افزارهای منبع باز به عنوان شیوه تولید جدید» است؛ مانند ویکی‌پدیا که با شیوه تولید قدیم کاملا درتضاد است. اما با خریدهای شرکت های غول به سمت دراختیار گرفتن این پلتفورم ها همچنان تا حد زیادی با شیوه سرمایه‌داری تولید سنتی مرتبط هستند. بعنوان مثال، اتفاق اخیر شرکت فیس بوک و فروش اطلاعات که در آن «فعالیت کاربران فیس بوک، کار ملموسی می‌باشد که «محتوای اطلاعاتی» را «تولید» می‌کند که نمایانگر ارزش مصرفی است. سپس این محتوا به کالا تبدیل می‌شود و با تبلیغ‌کنندگان و حتی جریانهای سیاسی به «فروش» می‌رسد، و کنترل این فرایند در دست صاحبان این زیرساخت است و مجدد همان کاربران که تولید کننده و خود مخاطبان تبلیغات هستند، «مصرف کننده» کالاخواهند بود.\r\n\r\nبا این تفاسیر به بررسی گذار به نظام ارزش جدید از جامعه صنعتی به جامعه اطلاعاتی می‌پردازد. چارچوب پیشنهادی در سه لایه ساختاربندی شد:\r\n\r\n(الف) تولید ارزش؛\r\n\r\n(ب) ثبت ارزش؛\r\n\r\n(ج) تحقق ارزش\r\n\r\nبر اساس این چارچوب؛ نظام ارزش جدیدی را از طریق بررسی یک مطالعه موردی می‌آزماییم. مدل اقتصادی مفهومیِ همکاری نامتمرکز مبتنی بر بلاک چین را شرح می‌دهیم. نهایتاً، با سناریویی آزمایشی برای فناوری بلاک چین که می‌تواند ایجاد اکوسیستم‌های اشتراک محور در اقتصاد اشتراکی را ممکن کند، جمع‌بندی می‌کنیم.\r\n\r\nتحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین\r\n\r\nما یک مورد نمونه از اکوسیستم نوظهور بلاک چین انتخاب کرده‌ایم. این فناوری تازه تاسیس از اقتصاد و علوم مالی تا قانون را درگیر نموده است و عمدتاً به عنوان موردی از ICT که بخش مالی و پولی را متحول ساخته یاد می‌شود که یک تحول در نهادها، سازمانها و حاکمیت را رهبری می‌کند. این فن آوری دیجیتال فرمی از «حاکمیت اجتماعی توزیعی» را تقویت می‌کند و محیطی برای ارزش‌گذاری ارائه میکند که نیازمند بررسی های دقیق ارزش واقعی موجود در این فضا است. مورد انتخاب‌شده برای نحوه ارزش گذاری پروژه‌ای به نام «Backfeed» است.\r\n\r\nبَکفید (Backfeed) یک سیستم‌عامل اجتماعی برای سازمان‌های غیرمتمرکز است بطوری که بر اساس فناوری بلاک چین برای توسعه یک مدل حاکمیتی توزیعی جهت ایجاد و توزیع ارزش نامتمرکز تهیه شده است. این پروتکل اجتماعی کمک می‌کند تا اعضای مشارکت کننده در مورد ارزیابی سهم، به میزان ارزش تولید شده و توزیع پاداش‌ها به یک اجماع برسند. این زیرساخت بلاک چین با انجام : الف) ابتدا با ثبت ارزیابی‌ها به‌طور دائمی باعث ایجاد شفافیت و امنیت آن‌ها در برابر دست‌کاری می‌شود. ب) تمرکز بر شیوه تولید باعث می‌شود تا ارزش دادوستد و نحوه تفسیر آن‌ها در محیط اجتماعی-نهادی به درستی صورت پذیرد که در نهایت از شکل­گیری یک اقتصاد پایدار پشتیبانی می‌کند.\r\n\r\nپروتکل Backfeed با جامعه OuiShare، (شبکه‌ای از محققان، فعالان و کارآفرینانی از اقتصاد اشتراکی است) در جشنواره OuiShare در پاریس در سال ۲۰۱۵  آزمایش شده است. این آزمایش با یک جلسه اولیه در اکتبر ۲۰۱۵ شروع شد به مدت شش ماه قبل از شروع جشنواره ادامه داشت.\r\n\r\nاکو سیستم Backfeed سه لایه­ی درهم‌تنیده را برای تشریح ارزش یکپارچه در بستر بلاک چین را تشریح میکند. لایه اول، تولید ارزش بوسیله ارتباط اشتراک‌گذاری ارزش‌های مصرفی با جامعه مشارکت‌کننده‌ها که در هسته آن قرار دارند. لایه دوم، استفاده از فناوری بلاک چین بعنوان رسانه‌ای برای ثبت ارزش و سوم، یک مدل اقتصادی مبتنی بر توکن، که به‌طور آزمایشی این سیستم ارزش جدید را یکپارچه می‌کند، و لایه نهایی را برای تحقق ارزش ارائه می‌کند. توکن هایی که از طریق فرایندهای مشارکتی صادر شده‌اند بیانگر کسر منصفانه‌ای از ارزش ایجاد شده و پاداش مشارکت کنندگان هستند، که به‌طور همزمان ارزش ادراکی محصولات و خدمات تولید شده را بازتاب می‌دهند.\r\n\r\nپروتکل Backfeed اکوسیستمی متشکل از انواع سیستم‌های ارزش است که شبکه توزیع در اقتصاد اشتراکی را تغذیه می‌کنند. در این اکوسیستم، بهای بیشینه سازی ارزش به سمت منفعت عمومی جامعه جابجا می‌شود و همه از ازرش افزده ایجاد شده منتفع می‌شوند.\r\n\r\nبرای فهم بهتر این پروتکل می‌توانیم اکوسیستمی را تصور کنیم که از چندین «مشارکت کننده DC» تشکیل‌شده است، و از تعامل بین آن‌ها، انبوهی از ارزش ظاهر می‌شوند. DC هایی که به‌صورت دوبه‌دو باهم تعامل دارند و عناصر تشکیل‌دهنده‌ی این اکوسیستم هستند که بر اساس میزان نیازشان به محصولات یا خدمات یکدیگر، از هم حمایت می‌کنند.\r\n\r\nتحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین\r\n\r\nبه‌عنوان‌مثال، یک کشاورزی ارگانیک (DC1) و یک (FabLab (DC2 را درنظر می‌گیریم. در یک زمان خاص، ممکن است که DC1 به خدمات DC2 برای ساخت ابزارهای خاص کشاورزی نیاز داشته باشد. برای این منظور، DC1 باید تعدادی از توکن های DC2 را برای کسب دسترسی به خدماتشان تهیه کند. لذا، DC1 مجبور خواهد بود: الف) یا در عملیات‌های DC2 برای کسب توکن به‌عنوان پاداش مشارکت کند، ب) یا در خرید توکن های DC2 سرمایه‌گذاری کند، در نتیجه به‌طور غیرمستقیم ارزش بازار این توکن ها را افزایش می‌دهد. به‌طور مشابه، اگر یک کسب‌وکار متعارف (نه از نوع DC) به خدمات FabLab نیاز داشته باشد با همین انتخاب‌ها روبرو خواهند بود. و یا شهروندان برای استفاده از محصولات ارگانیک، یا از طریق مشارکت در تولیدشان و یا از طریق خرید توکن ها، برخوردار می‌شوند. بنابراین، اکوسیستم DC از بخش دیگر جامعه جدا افتاده نخواهد بود و DC ها نیز می‌توانند با بازار و بخش عمومی ارتباط برقرار کنندو خود را گسترش داده و پایدار کنند.\r\n\r\nدر رابطه با سه لایه ارزشی که قبلاً شرح داده شدند، DC هسته ایجاد ارزش را در ارتباط با لایه اول (ایجاد ارزش) بازنمایی می‌کند. Backfeed تحولات را با تشویق کردن مردم به انجام مشارکت‌های معنادار در یک هدف مشترک توجیه می‌کند. مشارکت‌کنندگان بدون هیچ‌گونه نقش یا وظیفه از پیش تعریف‌شده مشارکت می‌کنند و بدون کسب مجوز، انرژی سازنده یا سایر منابع خود را با جامعه به اشتراک می‌گذارند.\r\n\r\nدر لایه دوم (ثبت ارزش) Backfeed یکی از امیدوارکننده‌ترین کارکردهای بلاک چین را مستقر می‌کند: پیشینه‌ی غیرمتمرکزی از ارزش، با توانایی پوشش دادن مشارکت‌هایی که به لحاظ کیفی متفاوت هستند. پروتکل PoV مکانیسمی را برای اجماع نامتمرکز ارائه می‌دهد که ارزش هر مشارکت را تعیین می‌کند. به‌طور همزمان، سیستم اعتباردهی، شایستگی را در داخل جامعه ارتقا می‌دهد، که با سطح مشارکت در هدف مشترک آن جامعه و هماهنگی با ارزش‌های آن جامعه مرتبط است. بنابراین، ادراکی از ارزش را سازمان‌دهی می‌کند که با همکاری معنادار مرتبط است.\r\n\r\nدر نهایت، در خصوص لایه سوم (مدل اقتصادی توکن)، مدلی برای نوع جدیدی از اقتصاد پیش‌بینی‌شده است که در آن ارزش منعکس کننده ظرفیت افراد برای مشارکت در به اشتراک‌گذاری، از نظر مشارکت در فرایندهای مشارکتی و بهره‌گیری از آن‌هاست. این امر از طریق کارکرد توکن ها، که با مشارکت فعال و تمایل واقعی به عملیات‌های DC مرتبط است، قابل دستیابی است. ارزش توکن ها زمانی برای مردم واقعی می‌شود که به آن‌ها اجازه داده شود که از محصولات و خدمات تولید شده موجود در اکوسیستم DC ها بهره‌مند شوند. به‌این‌ترتیب، توکن های یک DC، مقادیر معینی از ارزش هستند که نه‌تنها سودمندیِ ادراکیِ محصولات یا خدمات مربوطه را بازنمایی می‌کنند، بلکه به‌طور عام‌تر، سود را نیز برای اکوسیستم گسترده‌تر بازنمایی می‌کنند.\r\n\r\nرابطه‌ی متقابل Backfeed با این سه لایه ارزش، به‌صورت گرافیکی در شکل ۱ در زیر نشان داده شده است.\r\n\r\nتحلیل نظام ارزش در اقتصاد اشتراکی با فناوری بلاک چین\r\nشکل ۱٫ گذار از اقتصاد صنعتی به اقتصاد اطلاعاتی و سیستم‌های ارزش مرتبط. برگرفته از: کار خودِ نویسندگان. تحت مجوز CC-BY-SA 4.0.\r\n\r\nنوآوری بیت کوین سیستم مالی جهانی را با به نمایش گذاشتن ارز دیجیتال نامتمرکز و سیستم پرداختی که توسط هیچ دولت یا نهاد مالی‌ای کنترل نمی‌شود، دگرگون کرد. با این‌حال، سیستم ارزشی آن تفاوت زیادی با سیستم قیمت متعارف ندارد. و بعضا هم این سیستم ارزشگذاری مشکوک است و نامشخص و لذا فاقد چابکی برای واکنش مؤثر به تحولاتِ «به اشتراک‌گذاری» است. در مقابل، پروتکل فناوری Backfeed با تعمیم فرایند ماینینگ، انواع بسیار گسترده‌تری از مشارکت‌ها را در بر می‌گیرد یعنی هر چیزی که تصور می‌شود برای جامعه ارزش به ارمغان می‌آورد را شامل می‌گردد. پروتکل این فناوری تمرکز را از الگوریتم‌ها به روابط انسانی منتقل می‌کند، و به مشارکت فعالانه و مشارکت‌های معنادار، همسو با ارزش‌های جامعه، پاداش می‌دهد.\r\n\r\nنکته مهم‌تر اینکه، فرماندهی و کنترل سلسله مراتبی اهمیت کمتری دارد، افراد از منابع مشترک شده، بر اساس شایستگی و ارزش ادراکی‌شان، بهره‌مند می‌شوند. علاوه بر این، آن‌ها می‌توانند از طریق تبادل توکن ها از معاملات با جوامع دیگر پشتیبانی کنند و در آن‌ها مشارکت کنند، و همچنین در کنار نهادهای دولتی و جوامعِ بازار-محور سنتی همزیستی کنند و باقی بمانند.\r\n\r\nالبته استفاده از Backfeed، و یا هر سیستم ارزیابی مشابهی، چالش‌های خاصی را برای روابط داخلی در جوامع مولد ایجاد می‌کند، که با اعتماد، عمل متقابل، و انگیزه‌های ذاتی مرتبط هستند. علاوه بر این، این فناوری هنوز هم در مراحل بسیار ابتدایی‌اش قرار دارد و به داده‌های تجربی بیشتری برای پشتیبانی از کاربردش در زندگی واقعی نیاز است و خیلی زود است که نحوه عملکرد این فناوری را که هنوز هم به یک طراحی غالب نرسیده است در مقیاس بزرگ پیش‌بینی کنیم. درهرصورت، صرف‌نظر از توسعه فناوری بلاک چین و موفقیت نهایی Backfeed ، مدل مفهومی‌اش به‌ظاهر سناریوی جالبی را برای اقتصاد اشتراکی و نقشی که می‌تواند در جوامع ایفا کند ارائه می‌کند.</p>','published','learning',33),(9,' ارز دیجیتال چیست؟','arz','2018-05-25 08:04:32','','5b07c390b5b898.42859091.jpg','arz','شاید شما هم واژه «ارز دیجیتال» را در رسانه‌ها یا شبکه‌های اجتماعی شنیده باشید. اما ارز دیجیتال چیست ؟ چه تفاوت‌هایی با پول معمولی دارد؟ اگر به دنبال پاسخ این پرسش‌ها هستید، مطلب زیر می‌تواند برایتان سودمند باشد.\r\n\r\nواژه «ارز دیجیتال» ترجمه فارسی عبارت انگلیسی «cryptocurrency» است. این کلمه انگلیسی از دو عبارت crypto‌ به معنای رمز  و currency به معنای ارز تشکیل شده است. به همین دلیل گاهی از معادل «رمزارز»، «ارز رمزگذاری شده» یا «ارز رمزینه» برای این مفهوم نیز استفاده می‌شود. ارز دیجیتال در واقع یک شکل الکترونیکی از پول است که به صورت رمزنگاری شده در اینترنت از یک نفر به فردی دیگر متصل می‌شود. رمزارزها غیرقابل هک هستند.\r\n\r\nاطلاعات مربوط به مالکیت ارز دیجیتال و تراکنش‌ها بر روی شبکه‌ای که بلاک چین نامیده می‌شود قرار دارد. (در مطلبی با عنوان «بلاک چین به زبان ساده» به صورت مفصل در این باره توضیح دادیم.) این شبکه اطلاعات مذکور را در اختیار عموم قرار می‌دهد و همه کاربران می‌توانند سابقه تراکنش‌ها را ببینند.\r\n\r\nاز معروف‌ترین ارزهای دیجیتال می‌توان به بیت کوین، اتریوم، ریپل، لایت کوین و مونرو اشاره کرد.','published','news',46);
